import React, { PureComponent } from 'react'

export class Profile extends PureComponent {
  render() {
    return (
      <div>

        <div>
          <h2>Profile counter : 0</h2>
          <div>
            <button>-1</button>
            <button>-3</button>
            <button>-5</button>
          </div>
        </div>
      </div>
    )
  }
}

export default Profile
